import logo from './logo.svg';
import './App.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import {
//   BrowserRouter as Router,
//   Routes,
//   Route,
//   Switch,
//   Link
// } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="page-background">
        <div className="title">
          Ryan's Workshop
        </div >

        <Navbar>
        <Container className="topnav">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#programming">Programming</Nav.Link>
        <Nav.Link href="#Healthcare">Healthcare</Nav.Link>
        <Nav.Link href="#fitness">Fitness</Nav.Link>
        <Nav.Link href="#budgeting">Budgeting</Nav.Link>
        </Container>
        </Navbar>

      </header>
    </div>
  );
}

export default App;
